scriptlet.script:
try{
	variableNamesList = variableNames.split(delimiter);	
	for (var i = 0; i < variableNamesList.length; i++) {		 				
		scriptletContext.put(
			variableNamesList[i] + 'Flag',
			scriptletContext.get(variableNamesList[i]).trim() == 'Y' ? 'True' : 'False'
		);
	}	
	response = "success";
} catch(err) {
	errorMessage = 'An error occured while comparing screen flags : ' + err.message;
	scriptletContext.put("errorMessage", errorMessage);	
	response = "failure";
}
scriptletResponse = response
